<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" "http://www.w3.org/TR/html4/loose.dtd">
<html>
 <head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
    <title>RabbitMQ Performance</title>
    <link href="../lib/perf.css" rel="stylesheet" type="text/css">
    <!--[if lte IE 8]><script language="javascript" type="text/javascript" src="../lib/excanvas.min.js"></script><![endif]-->
    <script language="javascript" type="text/javascript" src="../lib/jquery.min.js"></script>
    <script language="javascript" type="text/javascript" src="../lib/jquery.flot.min.js"></script>
    <script language="javascript" type="text/javascript" src="../lib/perf.js"></script>
    <script language="javascript" type="text/javascript">
    $(document).ready(function() {
      var main_results;
        $.ajax({
            url: 'result.js',
            success: function(data) {
                render_graphs(JSON.parse(data));
            },
            fail: function() { alert('error loading result.js'); }
        });
    });
    </script>
 </head>
    <body>
    <h1>RabbitMQ Performance RaspberryPi Model 2 (armv71)</h1>


    <h3>Consume 1->1 armv71</h3>
    <div class="chart"
      data-type="time"
      data-latency="true"
      data-x-axis="time (s)"
      data-y-axis="rate (msg/s)"
      data-y-axis2="latency (μs)"
      data-scenario="consume 1->1 armv71">
		</div>
    <h3>Consume 1->2 armv71</h3>
    <div class="chart"
      data-type="time"
      data-latency="true"
      data-x-axis="time (s)"
      data-y-axis="rate (msg/s)"
      data-y-axis2="latency (μs)"
      data-scenario="consume 1->2 armv71">
		</div>

		<h3>Summaries</h3>

		<div class="summary" style="margin: 20px 20px 20px 20px;"
			data-scenario="consume 1->1 armv71">
			consume 1->1 armv71
		</div>
		<div class="summary" style="margin: 20px 20px 20px 20px;"
			data-scenario="consume 1->2 armv71">
			consume 1->2 armv71
		</div>

  </body>
 </html>
